# React CSS

## Inline Styles

Inline styles are the most basic way to style a react component. You can use the style prop to add inline styles to a component. The style prop takes an object with CSS properties as keys and values. For example, to add a background color to a div, you can use the following code:
```
<div style={{ backgroundColor: 'red' }}>Hello World!</div>
```
## CSS Modules

CSS Modules is a CSS preprocessor that allows you to write CSS in a modular way. It allows you to scope CSS classes to a specific component, which prevents CSS class name collisions. To use CSS Modules in a react app, you need to install the css-loader and style-loader packages. Then, you need to create a CSS file and import it into your react component. For example, to create a CSS file called styles.css and import it into a react component, you can use the following code:
```
import React from 'react';
import styles from './styles.css';

const MyComponent = () => {
  return (
    <div className={styles.myClass}>Hello World!</div>
  );
};

